INSERT INTO b_rating_prepare (ID)
SELECT DISTINCT U.ID
FROM 
(
	
	SELECT USER_START_ID as ENTITY_ID
	FROM b_forum_topic
	WHERE START_DATE > DATE_SUB(NOW(), INTERVAL 90 DAY)
	GROUP BY USER_START_ID
UNION ALL
	SELECT AUTHOR_ID as ENTITY_ID
	FROM b_forum_message
	WHERE POST_DATE > DATE_SUB(NOW(), INTERVAL 90 DAY)
	GROUP BY AUTHOR_ID
UNION ALL
	SELECT	AUTHOR_ID as ENTITY_ID
	FROM b_blog_post
	WHERE DATE_PUBLISH > DATE_SUB(NOW(), INTERVAL 90 DAY)
	GROUP BY AUTHOR_ID
UNION ALL
	SELECT AUTHOR_ID as ENTITY_ID
	FROM b_blog_comment
	WHERE DATE_CREATE > DATE_SUB(NOW(), INTERVAL 90 DAY)
	GROUP BY AUTHOR_ID
UNION ALL
	SELECT ENTITY_ID
	FROM b_rating_subordinate
	WHERE RATING_ID = 4
UNION ALL
	SELECT USER_ID as ENTITY_ID
	FROM b_rating_vote
	WHERE CREATED > DATE_SUB(NOW(), INTERVAL 90 DAY)
	GROUP BY USER_ID
) MS,
	b_user U
WHERE U.ID = MS.ENTITY_ID AND
U.ACTIVE = 'Y'
AND (CASE WHEN U.EXTERNAL_AUTH_ID IN ('bot', 'email', '__controller', 'replica', 'imconnector', 'sale', 'saleanonymous', 'shop', 'call') THEN 'Y' ELSE 'N' END) = 'N'	
AND U.LAST_LOGIN > DATE_SUB(NOW(), INTERVAL 90 DAY)

